import React from 'react';

import {
  Typography, Divider,
} from 'antd';

const { Title, Paragraph } = Typography;

const Introduction = () => (
  <Typography>
    <Title>React NEXT VR with Ant Design</Title>
    <Paragraph>
        Welcom to VR!
    </Paragraph>
    <Divider />
  </Typography>
);

export default Introduction;
